import React from 'react';
import './App.css';
import Submit from './components/submit';
import Video from './components/video';

function App() {
  return (
    <div className="App">
      <meta name="viewport" content="width=device-width, initial-scale=1.0" />
      <div>
        请选择要上传的视频文件 
      </div>
      <div>
        <Submit/>
      </div>
      <div>
        -------------------------------------------------------------
      </div>
      <div>
        <Video/>
      </div>
    </div>
  );
}

export default App;
